INSERT INTO `livre` (`LivreID`, `Isbn`, `Titre`, `NbreExemplaire`, `NbrePages`, `DatePublication`, `Resume`, `Image`, `Genre`, `AuteurID`) VALUES
(1, '2-08-071267-5', 'Des délits et des peines', 2, 187, '1765-01-01 00:00:00.000000', 'L\'été 1764, à Livourne, en Italie, un jeune homme de vingt-six ans publie anonymement un court essai traitant de \" la cruauté des supplices et de l\'irrégularité des procédures criminelles \". Le marquis Cesare Beccaria, auteur de l\'essai, ne va pas rester longtemps inconnu. Son texte connaît un succès foudroyant, pénètre sur la scène française, est traduit, se répand dans toute l\'Europe. Voltaire, Diderot, d\'Alembert l\'acclament', , 'Droit', 2);
INSERT INTO `livre` (`LivreID`, `Isbn`, `Titre`, `NbreExemplaire`, `NbrePages`, `DatePublication`, `Resume`, `Image`, `Genre`, `AuteurID`) VALUES
(2, '2130550975', 'Vocabulaire juridique', 3, 925, '2005-08-10 16:39:10.000000', 'Définir après les avoir identifiés, les termes juridiques de la langue française, tel est l\'objet de ce Vocabulaire juridique. S\'appuyant sur un premier travail réalisé par Henri Capitant en 1936, Gérard Cornu a développé \" une oeuvre nouvelle par ses entrées, sa méthode, ses auteurs... L\'éminente vocation du Vocabulaire juridique est de saisir, dans les définitions, les catégories du droit. \" Plus qu\'une série de définitions de termes et d\'expressions, ce Vocabulaire est un outil de consultation et de recherche..', , 'Droit', 3);
INSERT INTO `livre` (`LivreID`, `Isbn`, `Titre`, `NbreExemplaire`, `NbrePages`, `DatePublication`, `Resume`, `Image`, `Genre`, `AuteurID`) VALUES
(3, '978-2-7076-1506-0', 'Droit civil. La famille', 4, 656, '2006-10-15 00:00:00.000000', 'Depuis les années soixante, le droit civil français de la famille a été radicalement transformé, refondu et refondé, par une série de lois fondamentales. La plupart de celles qui correspondent à l\'enseignement du droit de la famille ont été regroupées ici : réforme de l\'autorité parentale, réforme de la filiation, réforme du divorce, en partie réforme du droit matrimonial. C\'est un monument et un moment essentiel de la législation civile.', , 'Droit', 3);
INSERT INTO `livre` (`LivreID`, `Isbn`, `Titre`, `NbreExemplaire`, `NbrePages`, `DatePublication`, `Resume`, `Image`, `Genre`, `AuteurID`) VALUES
(4, '458-62-126-00', 'Le père Goriot', 2, 234, '2015-06-01 00:00:00.000000', 'La Comédie humaine - Études de moeurs. Troisième livre, Scènes de la vie parisienne - Tome I. Neuvième volume de l\'édition Furne 1842. Extrait : La vieille demoiselle Michonneau gardait sur ses yeux fatigués un crasseux abat-jour en taffetas vert, cerclé par du fil d’archal qui aurait effarouché l’ange de la Pitié.', , 'ROMAN', 4);
INSERT INTO `livre` (`LivreID`, `Isbn`, `Titre`, `NbreExemplaire`, `NbrePages`, `DatePublication`, `Resume`, `Image`, `Genre`, `AuteurID`) VALUES
(5, '2-08-211182-2', 'Une brève histoire du temps', 2, 246, '2017-08-06 00:00:00.000000', 'Voici le premier livre que Stephen Hawking ait écrit pour le grand public. Il y expose, dans un langage accessible à tous, les plus récentes découvertes des astrophysiciens. Retraçant les grandes théories du cosmos depuis Galilée jusqu\'à Einstein, racontant les ultimes découvertes en cosmologie, expliquant la nature des trous noirs, il propose ensuite de relever le plus grand défi de la science moderne : la recherche d\'une théorie permettant de concilier la relativité générale et la mécanique quantique.', , 'Science', 5);
INSERT INTO `livre` (`LivreID`, `Isbn`, `Titre`, `NbreExemplaire`, `NbrePages`, `DatePublication`, `Resume`, `Image`, `Genre`, `AuteurID`) VALUES
(6, '978-2738123602', 'L\'Univers dans une coquille de noix', 4, 211, '2009-10-06 17:08:05.000000', 'Après Une brève histoire du temps et Trous noirs et bébés univers, Stephen Hawking fait le point sur les stupéfiantes percées théoriques qui ont eu lieu depuis la publication de son précédent livre. Avec le style à la fois érudit et accessible qui le caractérise, il nous fait découvrir tour à tour la relativité einsteinienne, le principe d\'incertitude, la mécanique quantique, les cinq théories des cordes, la théorie M et les mystérieuses p-branes voie d\'accès, peut-être, au Graal de la physique : la \"théorie de tout\".', , 'Science', 5);
INSERT INTO `livre` (`LivreID`, `Isbn`, `Titre`, `NbreExemplaire`, `NbrePages`, `DatePublication`, `Resume`, `Image`, `Genre`, `AuteurID`) VALUES
(7, '0-375-70405-1', 'L\'Eveil', 5, 409, '2016-02-23 17:20:22.000000', 'Inspire de l\'experience du Dr Oliver Sacks, neurologue new-yorkais, qu\'il consigna dans un livre, l\'Eveil retrace l\'histoire d\'un jeune chercheur qui se voit confier un groupe de malades chroniques atteints de troubles psychiques profonds, derniers rescapes d\'une epidemie d\'encephalite.', , 'Science', 6),
(8, '978-2-02-101129-6', 'L\'œil de l\'esprit', 5, 288, '2012-02-02 00:00:00.000000', 'Après avoir étudié l\'ouïe dans Musicophilia, Sacks explore ici la vision. La méthode est la même : une série de petites nouvelles neurologiques, récit de cas étonnants : la musicienne qui ne sait plus déchiffrer la musique (et bientôt ne reconnaît plus les objets), le romancier qui ne peut plus lire (mais étrangement arrive toujours à écrire), sa propre difficulté, à lui, Sacks, de reconnaître les visages', , 'Science', 6);
